import React from 'react';
import { GetMovie } from '../Reducers/MovieReducer';
import { useDispatch, useSelector } from 'react-redux';

 function Read() {
  const dispatch = useDispatch();
  const movies = useSelector((state) => state.MovieData.movies); 

  return (
    <div>
      <button onClick={() => { dispatch(GetMovie()) }}>Fetch data</button>
      <div>
     
          {movies.map((ele) => (
           <div key={ele.id}>{ele.title}</div>
          ))}
       
      </div>
    </div>
  );
}
export default Read()
